use cs3380;

-- clean up
-- Order matters!
drop table if exists player;


CREATE TABLE player (
    player_id VARCHAR(255) primary key,
    display_name VARCHAR(255),
    common_first_name VARCHAR(255),
    first_name VARCHAR(255),
    last_name VARCHAR(255),
    birth_date DATETIME,
    jersey_number integer,
    position VARCHAR(255),
    years_of_experience integer
);

-- Schema for game
CREATE TABLE game (
    game_id integer primary key,
    season integer,
    game_type VARCHAR(255),
    week integer,
    gameday TEXT,
    away_team VARCHAR(255) REFERENCES team(team),
    away_score integer,
    home_team VARCHAR(255) REFERENCES team(team),
    home_score integer
);

-- Schema for team
CREATE TABLE team (
    team VARCHAR(255) primary key,
    team_name VARCHAR(255),
    col integer,
    team_division VARCHAR(255),
    team_nick VARCHAR(255)
);

CREATE TABLE Plays (
    game_id integer REFERENCES game(game_id),
    season integer,
    game_type VARCHAR(255),
    week integer,
    away_team VARCHAR(255) REFERENCES team(team),
    home_team VARCHAR(255) REFERENCES team(team)
);

CREATE TABLE Stadium (
    stadium_id VARCHAR(255) PRIMARY KEY,
    stadium VARCHAR(255)
);


